import React from 'react';

import Navigation from'../../components/componentsMain/menu/Navigation';
import Footer from '../../components/componentsMain/container/Footer';
import ButtonFloat from '../../components/componentsMain/buttons/ButtonFloat';

export default function ArticlesOne() {
  return(

      <div onScroll="onScroll()" className="" id="homePage">
            <Navigation/>
        <div>
        <div className="one" id=""> 
        <p> Embora a arquitetura colonial seja um destaque e tanto entre as dezenas de atrações da cidade histórica mais famosa do Rio de Janeiro, é impossível organizar uma viagem e não querer aproveitar também as praias de Paraty.

O que é compreensível, afinal, o mar por estes lados rende passeios privilegiados.

E se engana quem pensa que o destino tem poucos pedaços de areia à disposição. Apesar de as praias mais atraentes ficarem afastadas do centro-histórico de Paraty, é possível dedicar ao menos três dias inteiros somente para se encantar com a costa da cidade.

No entanto, como sei que nem todos os viajantes têm tanto tempo disponível, neste post vou te contar o que você pode esperar das melhores praias de Paraty. 

Tenha em mente, porém, que algumas das praias que serão indicadas não são paradisíacas. Ainda assim, entraram nesta lista por alguma particularidade especial.
</p>
        </div>
        </div>
        <ButtonFloat/>
        </div>
      );
};
